void main() {
  float id = vertexId;

  float ux = floor(id / 6.) + mod(id, 2.);

  float vy = mod(floor(id / 2.) + floor(id / 3.), 2.);

  float angle = ux * radians(180.0) / (vertexCount * 0.00333333);
  float c = cos(angle);
  float s = sin(angle);

  float radius = vy;

  float a = resolution.x / resolution.y;

  float x = c * radius / a;
  float y = s * radius;

  vec2 xy = vec2(x,y);
  gl_Position = vec4(xy* .5, 0, 1);
  v_color = vec4(1, 0, 0, 1);
}
